import PortfolioItems from './PortfolioItem';
function Portfolio() {
    return(
        <div id="portfolioPage" className="pages">
            <div className="container">
                <div className='row'>
                    <PortfolioItems />
                    <PortfolioItems />
                    <PortfolioItems />
                    <PortfolioItems />
                </div>
            </div>
        </div>
    );
}
export default Portfolio;
